At a time when the future of sport competition is still unknown, martial arts and kickboxing clubs are actively engaging their members in training, setting personal goals, and encouraging members to become the best versions of themselves.

Our WAKO member clubs have outstanding coaches that prepare new competitors for development competitions, as well as elite level athletes for National and International events. 

